Maskinsydd och handsydd tröja för plojke stl ca 6-7 år av kyprat svart ylleyg.  Tröjan är fodrat med beige bomullsdamast. Fodertyget består av mönster i blomslingor över hela ytan. Tröjans ärmuppslag och krage är i rött bommulstyg i satinbindning. Krage och ärmslag har blomsterboroderier sydda i grönt och gult bommulsgarn med stjälkstygn och flätstygn.
Tröjan är öppen mitt fram och har längst bägge framkanterna sex knappar som dekor. Vid halsen, på höger sidas foder, sitter en hake  fastsydd och på vänster sidas yttertyg är det en sydd träns. Mitt bak finns två djupa skört som bildats när tygstyckena vikts till motveck. 
//2013-02-06 Anna-Karin Jobs Arnberg

Kvinnotröja stickad av grönsvart tunt ullgarn, rundstickad i  slätstickning med  2 cm resårkant  och små sidsprund.  Fyrkantig halsringning infodrad med en remsa oblekt linnelärft. ärmarna formstickade med utläggningar på undersidan i en linje, 11 cm långa ärmsprund med 2 kantsydda hål för  stolpknapp och 2 trådöglor Runt ärmen 2 kantband av blommmönstrade sidenband  båda med mönster på svart botten men så söndernötta att mönstret inte kan urskiljas. ärmarna vidsydda mot bålen.
Tröjan så tunn och så tätstickad att det skulle kunna vara maskinstickning. har tillhört fru Kjersti Salomon f. Hansdotter i Västra Vemmerlöv.
//Berit Eldvik 2010-12-15
